import React from 'react';
import { TriageStartResponse } from '../types/TriageTypes';

interface ResultsDisplayProps {
  results: TriageStartResponse[];
  isLoading: boolean;
}

const ResultsDisplay: React.FC<ResultsDisplayProps> = ({ results, isLoading }) => {
  const formatTimestamp = (timestamp: string) => {
    return new Date(timestamp).toLocaleString('tr-TR', {
      year: 'numeric',
      month: '2-digit',
      day: '2-digit',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  const getLevelBadgeClass = (level: string) => {
    const levelNum = level.toLowerCase().replace('esi-', '');
    return `level-badge level-esi-${levelNum}`;
  };

  const getLevelText = (level: string) => {
    const levelMap: { [key: string]: string } = {
      'ESI-1': 'Acil - Yaşamsal Tehlike',
      'ESI-2': 'Acil - Yüksek Risk',
      'ESI-3': 'Acil - Orta Risk',
      'ESI-4': 'Acil Olmayan - Düşük Risk',
      'ESI-5': 'Acil Olmayan - Minimal Risk'
    };
    return levelMap[level] || level;
  };

  if (isLoading) {
    return (
      <div className="results-panel">
        <h2>Değerlendirme Sonuçları</h2>
        <div className="no-results">
          <div className="loading-spinner"></div>
          <p>Triage değerlendirmesi yapılıyor...</p>
        </div>
      </div>
    );
  }

  if (results.length === 0) {
    return (
      <div className="results-panel">
        <h2>Değerlendirme Sonuçları</h2>
        <div className="no-results">
          <p>Henüz değerlendirme yapılmadı. Hasta bilgilerini girerek başlayın.</p>
        </div>
      </div>
    );
  }

  return (
    <div className="results-panel">
      <h2>Değerlendirme Sonuçları</h2>
      <div className="results-list">
        {results.map((result, index) => (
          <div key={index} className="result-card">
            <div className="result-header">
              <h3>Hasta #{index + 1}</h3>
              <div className="case-info">
                <span className="case-id">#{result.case_id}</span>
                <span className="timestamp">
                  {new Date().toLocaleString('tr-TR')}
                </span>
              </div>
            </div>

            <div className="result-content">
              <div className="triage-level">
                <span>Triage Seviyesi:</span>
                <span className={getLevelBadgeClass(result.triage.triage_level)}>
                  {getLevelText(result.triage.triage_level)}
                </span>
              </div>

              {result.triage.rationale_brief && (
                <div className="rationale">
                  <strong>Değerlendirme Gerekçesi:</strong>
                  <p>{result.triage.rationale_brief}</p>
                </div>
              )}

              {result.triage.red_flags && Array.isArray(result.triage.red_flags) && result.triage.red_flags.length > 0 && (
                <div className="red-flags">
                  <strong>🚨 Kırmızı Bayraklar:</strong>
                  <ul>
                    {result.triage.red_flags.map((flag: string, idx: number) => (
                      <li key={idx}>{flag}</li>
                    ))}
                  </ul>
                </div>
              )}

              {result.triage.immediate_actions && Array.isArray(result.triage.immediate_actions) && result.triage.immediate_actions.length > 0 && (
                <div className="immediate-actions">
                  <strong>⚡ Acil Müdahaleler:</strong>
                  <ul>
                    {result.triage.immediate_actions.map((action: string, idx: number) => (
                      <li key={idx}>{action}</li>
                    ))}
                  </ul>
                </div>
              )}

              {result.triage.routing && result.triage.routing.specialty && (
                <div className="routing">
                  <strong>📍 Yönlendirme:</strong>
                  <p>{result.triage.routing.specialty} - {result.triage.routing.priority}</p>
                </div>
              )}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ResultsDisplay;
